import React, { memo, ReactNode, VFC } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import { Header } from './components/Header';
import { ItemDetail } from './components/ItemDetail';
import { ItemsLists } from './components/ItemsLists';


type Props = {
  exact: boolean;
  path: string;
  children: ReactNode;
  loginUser: boolean;
};

const App:VFC<Props> = memo(() => {

  const { exact, path, children, loginUser } = props;

  return (
    <div className="App">
      <Header/>
      <BrowserRouter>
        <Routes>
          <Route exact={exact} path='/' component={ItemsLists}/>
          <Route  path='/detail' component={ItemDetail}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
})

export default App;
